import {React, useState, useEffect} from 'react'
import {ethers} from 'ethers'

const EventTable = (props) => {
    let contract = props.contract.contract;
    let defaultAccount = props.contract.defaultAccount;
    const [Event, setEvent] = useState();

    const getEvents = async () => {
        let contractAddress = await contract.address;

        let events = contract.filters.Transfer('0x8f019d1aa9cd5cba7d9f1e878cefdd1efbe2f74d', contractAddress);
        console.log(events);
        setEvent(events);
    }

    useEffect(() =>{
        if (contract != null){
            getEvents();
        } else {
            setEvent("null");
        }
    },[contract, defaultAccount])

    return (
        <div>
            <p>{Event}</p>
        </div>

    );
}
export default EventTable;
